	initialize_memory(kernel_start, kernel_end, mem_map, mem_map_size);

	// ustawianie wskaźników do programów, które będzie można uruchomić spawnerem
	set_progs(5, named_semu, dying, dying_with_threads, mem_testing, sem_testing);
	ADD_PROG_NAME(named_semu);
	ADD_PROG_NAME(dying);
	ADD_PROG_NAME(dying_with_threads);
	ADD_PROG_NAME(mem_testing);
	ADD_PROG_NAME(sem_testing);

	printf("Kernel directory: %x\n", kernel_directory_struct.directory_addr);

	unsigned int th_error = 0;
	thread_t *t2, *t1, *t3, *t32;
	th_error = 0;

	t1 = thread_setup((elf_header *)mem_testing, -1, &th_error);
	// t2 = thread_setup((elf_header *)unnamed_sems, -1, &th_error);
